import React, { Component } from 'react'
import { BrowserRouter as Router , Route , Switch } from 'react-router-dom'
import UserList from './components/users/userList'
import Welcome from './components/index/welcome'
import UserAdd from './components/users/userAdd';
import Admin from './components/operations/admin/sideNav'


export class App extends Component {
  render(){
    return(
      <div>
      <Router>
        <Switch>
          <Route exact path="/" component={Welcome}></Route>
          <Route exact path="/users" component={UserList}></Route>
          <Route exact path="/users/add" component={UserAdd}></Route>
          <Route exact path="/operations/admin" component={Admin}></Route>
        </Switch>
      </Router>
    </div>
    )
  }
}

export default App
